import React from "react";
import "./App.css";
import Navbar from "./Components/Navbar";
import Expenses from "./Components/Expenses/Expenses";
import ExpensesFrom from "./Components/AddExpenses/ExpensesForm";
const App = () => {
  const expense = [
    {
      title: "Car Insurance",
      amount: "9456",
      date: new Date(2021, 4, 12),
    },
    {
      title: "Car Insurance",
      amount: "9456",
      date: new Date(2021, 4, 12),
    },
    {
      title: "Csr Insurance",
      amount: "9456",
      date: new Date(2021, 4, 12),
    },
    {
      title: "Car Insurance",
      amount: "9456",
      date: new Date(2021, 4, 12),
    },
  ];
  const addExpenseHandler = (expense) => {
    console.log("In App");
    console.log(expenses);
  };
  return (
    <div>
      <Navbar />
      <ExpensesFrom />
      <Expenses
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      />
      <Expenses
        title={expense[1].title}
        amount={expense[1].amount}
        date={expense[1].date}
      />
      <Expenses
        title={expense[2].title}
        amount={expense[2].amount}
        date={expense[2].date}
      />
      <Expenses
        title={expense[3].title}
        amount={expense[3].amount}
        date={expense[3].date}
      />
    </div>
  );
};
export default App;
